    for i in range(n):
        pos[a[i]] = i
    dp = [0] * (n + 1)
    for i in range(n - 1, 0, -1):
        j = pos[i]
        for k in range(j, n, i):
            if a[k] > i:
                if dp[a[k]] == 0:
                    dp[i] = 1
        for k in range(j, -1, -i):
            if a[k] > i:
                if dp[a[k]] == 1:
                    dp[i] = 1
    result = []
    for i in range(n):
        if dp[a[i]] == 0:
            result.append('B')
        else:
            result.append('A')
    return ''.join(result)

